local BasicNPC = require "object/BasicNPC"
local Do = require "actions/Do"
local Animate = require "actions/Animate"

return function(self, player)
    if self.hit then
        return
    end
    self.hit = true
    local npc1 = BasicNPC(
        player.scene,
        {name = "objects"},
        {name = "mecharm", x = player.x + 200, y = 400, width = 300, height = 92, properties = {nocollision = true, sprite = "art/sprites/mechaarmrace.png"}}
    )
    player.scene:addObject(npc1)
    npc1:run {
        Animate(npc1.sprite, "up"),
        Do(function() print("got em!") end)
    }
    local npc2 = BasicNPC(
        player.scene,
        {name = "objects"},
        {name = "mecharm", x = player.x + 150, y = 180, width = 300, height = 92, properties = {nocollision = true, sprite = "art/sprites/mechaarmrace.png"}}
    )
    player.scene:addObject(npc2)
    npc2:run {
        Animate(npc2.sprite, "down"),
        Do(function() print("got em!") end)
    }
end
